      nama: "Kurt cobain",
      treatment: "Kontrol behel",
      jam: "11:00",
      btnFinish: "Finish",
      btnCancel: "Cancel",
    },
    {
      deleteIcon: DeleteImage,
      fotoPasien: Kurt,
      nama: "Kurt cobain",
      treatment: "Kontrol behel",
      jam: "11:00",
      btnFinish: "Finish",
      btnCancel: "Cancel",
    },
    {
      deleteIcon: DeleteImage,
      fotoPasien: Kurt,
      nama: "Kurt cobain",
      treatment: "Kontrol behel",
      jam: "11:00",
      btnFinish: "Finish",
      btnCancel: "Cancel",
    },
    {
      deleteIcon: DeleteImage,
      fotoPasien: Kurt,
      nama: "Kurt cobain",
      treatment: "Kontrol behel",
      jam: "11:00",
      btnFinish: "Finish",
      btnCancel: "Cancel",
    },
    {
      deleteIcon: DeleteImage,
      fotoPasien: Kurt,
      nama: "Kurt cobain",
      treatment: "Kontrol behel",
      jam: "11:00",
      btnFinish: "Finish",
      btnCancel: "Cancel",
    },
  ];

  return (
    <div className="ContainerLuar2">
      <NewAppointment popup={popupShow} setPopup={setPopupShow} />

      <div className="ContainerDua">
        <div className="Header">Jadwal Pasien</div>

        <HeaderMenu
          functionKiri={() => setPopupShow(true)}
          btnKiri="+New Appointment"
          btnKanan="Today v"
        />

        <div className="CardContainer1">
          {cardData.map((data, index) => (
            <Card
              key={index}
              imageDelete={data.deleteIcon}
              image={data.fotoPasien}
              nama={data.nama}
              perawatan={data.treatment}
              jam={data.jam}
              btnFinish={data.btnFinish}
              btnCancel={data.btnCancel}
              functionFinish={() => setPopupShow(true)}

            />
          ))}
        </div>
      </div>
    </div>
  );
};

const HomeContainer = () => {
  return (
    <div className="ContainerUtama">
      <NavigationContainer />
      <Isi />
    </div>
  );
};

export default HomeContainer;
